    useEffect(() => {
        fetch('https://api.coingecko.com/api/v3/coins/${Id}')
        .then(res=>res.json())
        .then((result)=>{
            setItems(result)
        }).catch((error)=>{console.log(error)})

    }, [])

    console.log(items)


